import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('load');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to get to products page
    await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('.category-card:has-text("Electronics")');

    // Wait for sort controls to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for products to re-render
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract product prices to verify sort
    const prices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent;
        const match = priceText.match(/\$(\d+\.\d{2})/);
        return match ? parseFloat(match[1]) : 0;
      })
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) on Electronics category",
      extractedData: {
        productCount: prices.length,
        lowestPrice: Math.min(...prices),
        highestPrice: Math.max(...prices)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
